import Navbar from "./NavBar";
import Graficos from "./pages/gráficos";
import Votacao from "./pages/votacao";

function App(){
    let Component
    switch (window.location.pathname) {
        case "/":
            Component = App
            break;
        case "/graficos":
            Component = Graficos
            break;
        case "votacao":
            Component = Votacao
            break;
    }


    return (
        <>
        <Navbar / >
        <Component />
        </>
    )
}

export default App
